function CreateMap(mapId, mapJson, pageNum, callback){
	let save_target = "A25"
	for(let i = 0; i < mapJson.length; i++){
		mapJson[i]["value"] = mapJson[i]["value"+pageNum]
	}

	let data = mapJson
	document.getElementById(mapId).highcharts('Map', {
		chart: {
			borderWidth: 1,
			events: {
				click: ()=> { //ie7에서 클릭할 때 반응하기 위한 이벤트 위치
					if(this.hoverPoint != null) {
						var obj = this.hoverPoint
						//save_area_point_code = obj.code //현재 선택되어 있는 지점 코드 저장
						//save_area_point_ko = obj.properties.SGG_NM //현재 선택되어진 지점명 저장

						callback(obj.properties.SGG_NM, obj.value, obj.properties.SGG_CD, obj.code)
					}
				}
			}
		},

		title: { text: '' },
		legend: { enabled : false },
		mapNavigation: { enabled: true },

		/* 없애고 데이터 자체에 color 로 넣어도됨 */
		colorAxis: {
			dataClasses: [{
				from: -100,
				to: 20,
				color: "#e5e5e5"
			}, {
				from: 21,
				to: 24,
				color: "#FED98E"
			}, {
				from: 25,
				to: 27,
				color: "#FD8D3C"
			}, {
				from: 28,
				to: 30,
				color: "#F03B20"
			}, {
				from: 31,
				to: 100,
				color: "#54278F"
			}]
		},

		series: [{
			data: data,
			mapData: Highcharts.maps['korea/drought_base'],
			joinBy: ['SGG_CD', 'code'],
			dataLabels: {
				enabled: false,
				color: '#FFFFFF'
			},
			name: ' ',
			tooltip: {
				pointFormatter: ()=>{
					let val = this.value
					let lv = ""
					if(save_target == "A21" || save_target == "A23" || save_target == "A24" || save_target == "A25"){
						if(val < 21){
							lv = "관심"
						}else if(21 <= val && val < 25){
							lv = "주의"
						}else if(25 <= val && val < 28){
							lv = "경고"
						}else if(28 <= val && val < 30){
							lv = "위험"
						}else if(30 <= val){
							lv = "매우위험"
						}

					}else{
						if(val < 21){
							lv = "관심"
						}else if(21 <= val && val < 25){
							lv = "주의"
						}else if(25 <= val && val < 28){
							lv = "경고"
						}else if(28 <= val && val < 31){
							lv = "위험"
						}else if(31 <= val){
							lv = "매우위험"
						}
					}
					let redata = this.properties.SGG_NM + ' : ' +  lv + "(" + val + ")"
					return redata
				}
			},
			point:{
				events: {
					click: ()=>{
						/* 액션필요 */
						//save_area_point_code = this.code //현재 선택되어있는 지점 코드 저장
						//save_area_point_ko = this.properties.SGG_NM //현재 선택되어진 지점명 저장
						callback(this.properties.SGG_NM, this.value, this.properties.SGG_CD, this.code)
					}
				}
			}
		},{
			data: Highcharts.geojson(Highcharts.maps['korea/mapline'], 'mapline'),
			enableMouseTracking: false,
			name: 'line',
			type: 'mapline',
			color: '#808080',
			lineWidth: 1,
			zIndex:10
		}]
	})
}